import logo from './logo.svg';
import { useState } from 'react';
import './App.css';

function First() {
  return(
    <>
      <img src={logo} className="App-logo" alt="logo" />
    </>
  )
}

function Second() {
  return(
    <>
      <span>Picture went away</span>
    </>
  )
}

function EvenOdd() {
  let [number, setCount] = useState(0);

  function add() {
    setCount(number++);
  }

  return(
    <>
    <button onClick={add}>Press</button>
        { number % 2 === 0 ? <First /> : <Second /> }
    </>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <EvenOdd />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
